import React from "react";
import { Link } from "react-router-dom";

interface HeaderProps {}

export const Header: React.FC<HeaderProps> = ({}) => {
  return (
    <header>
      <Link to="/">home </Link>
      <Link to="/register">register </Link>
      <Link to="/login">login</Link>
    </header>
  );
};
